import React from 'react';
import {useState} from 'react';

function App() {

  const getFetch = () => {
   try {
    const data = "http://localhost:8080/sign/all";
    fetch(data)
      .then(result => {
        const content = result.json();
        console.log(content);
      })
      .catch(err => console.log(err));
   } catch (error) {
      console.log(error);
   }
  }

  getFetch();

  return (
    <div>
      App
    </div>
  )
}

export default App
